    false,nt"url": null,nt"notes": "This document provides a standard process
    for San Pablo Bay National Wildlife Refuge to follow when making decisions regarding
    management of mosquitos and mosquito-borne disease. The Refuge proposes to implement
    a Mosquito Management Plan that consists of a phased approach to mosquito management
    and is consistent with principles of integrated pest management. Mosquito control
    managment plans and documentation of management actions are necessary to protect
    both threatened and endangered plants, fish, and wildlife and to ensure the health
